import { useState } from 'react';

function LandingPage() {
  const [greeting, setGreeting] = useState("Welcome to the Landing Page");

  return (
    <div>
      <h1>{greeting}</h1>
      <button onClick={() => setGreeting("Thanks for visiting!")}>Click Me</button>
    </div>
  );
}

export default LandingPage;
